import styled from 'styled-components';

let data = {};

export default function WelcomePage ({ data }) {
    return(
        <Container>
            <h1>Hello, <span id="displayName"></span></h1>
        </Container>
    );
}

const Container = styled.div`
    height: 100vh;
    min-width: 600px;
    width: 100%;
    background-color: #36454F;
    display: flex;
    align-items: center;
    h1 {
        margin: 0 auto;
        font-family: 'Montserrat', sans-serif;
        font-weight: 900;
        font-size: 85px;
        color: white;
    }
`;
